import React, { useState } from 'react';
import CalendarPage from './CalendarPage';
import ViewDataPage from './ViewDataPage';
import ProfilePage from './ProfilePage';
import Navbar from './Navbar';

const App = () => {
    const [currentPage, setCurrentPage] = useState('calendar'); // Track current page

    const renderPage = () => {
        switch (currentPage) {
            case 'calendar':
                return <CalendarPage setCurrentPage={setCurrentPage} />;
            case 'viewdata':
                return <ViewDataPage setCurrentPage={setCurrentPage} />;
            case 'profile':
                return <ProfilePage />;
            default:
                return <CalendarPage setCurrentPage={setCurrentPage} />;
        }
    };

    return (
        <div>
            <Navbar setCurrentPage={setCurrentPage} />
            {renderPage()}
        </div>
    );
};

export default App;
